import { useState } from "react";
import { Row, Col } from "react-bootstrap";
import { Link } from "react-router-dom";
import { DndProvider } from "react-dnd";
import { HTML5Backend } from "react-dnd-html5-backend";
import HitterList from "./components/HitterList";
import PicherList from "./components/PitcherList";

import style from "./css/Market.module.css";
import { useEffect } from "react";

const Market = () => {
  useEffect(() => {
    initHittersRef.current = [
      {
        hitterSeq: 1,
        batArm: "우타",
        name: "리오넬 메시",
        avg: 0.314,
        game: 0.123,
        atBat: 0.456,
        obp: 0.789,
        slg: 0.159,
        homerun: 2,
      },
      {
        hitterSeq: 2,
        batArm: "좌타",
        name: "레오나르도 다빈치",
        avg: 0.314,
        game: 0.123,
        atBat: 0.456,
        obp: 0.789,
        slg: 0.159,
        homerun: 2,
      },
    ];
    initPitchersRef.current = [
      {
        pitcherSeq: 1,
        pitArm: "좌완",
        name: "선발투수1",
        era: 0.274,
        game: 50,
        inning: 180,
        win: 37,
        lose: 11,
      },
      {
        pitcherSeq: 2,
        pitArm: "우완",
        name: "선발투수2",
        era: 0.274,
        game: 50,
        inning: 180,
        win: 37,
        lose: 11,
      },
    ];
  }, []);

  const initHittersRef = useRef([]);
  const initPitchersRef = useRef([]);

  const [toggle, setToggle] = useState(true);

  const [hitters, setHitters] = useState([]);
  const [pitchers, setPitchers] = useState([]);

  const [number, setNumber] = useState(100000);

  const clickToggleBtn = () => {
    setToggle(!toggle);
  };

  return (
    <>
      <DndProvider backend={HTML5Backend}>
        <Row className={style["background"]}>
          <div style={{ "margin-top": "auto", "margin-bottom": "auto" }}>
            <Row className={style["marketHead"]}>
              <div>이적 시장</div>
            </Row>
            <Row className={style["marketBody"]}>
              <Row>
                <Col>
                  <Row className={style["playerListHead"]}>
                    <div>선수 목록</div>
                  </Row>
                  <Row className={style["playerListBody"]}>
                    {toggle && <HitterList hitters={hitters}></HitterList>}
                    {!toggle && <PicherList pitchers={pitchers}></PicherList>}
                  </Row>
                </Col>
                <Col>
                  <Row>
                    <Row className={style["budget-top"]}>
                      <Col>
                        <div>예산 한도</div>
                      </Col>
                      <Col>
                        <div>사용 가능 예산</div>
                      </Col>
                    </Row>
                    <Row className={style["budget-bottom"]}>
                      <div className={style["budget-bottom-left"]}>
                        <div></div>
                        <div>{number.toLocaleString("ko-KR")} TG</div>
                      </div>
                      <div className={style["budget-bottom-right"]}>
                        <div></div>
                        <div>{number.toLocaleString("ko-KR")} TG</div>
                      </div>
                    </Row>
                  </Row>
                  <Row>
                    <Row className={style["playerHead"]}>
                      <div>보유 선수</div>
                    </Row>
                    <Row className={style["playerBody"]}>
                      {toggle && <HitterList hitters={hitters}></HitterList>}
                      {!toggle && <PicherList pitchers={pitchers}></PicherList>}
                    </Row>
                  </Row>
                </Col>
              </Row>
              <Row className={style["btnGroup"]}>
                <Link
                  className={`${style["btn"]} ${style["bg-color-cst1"]}`}
                  to="/main"
                >
                  MAIN
                </Link>
                <Link
                  className={`${style["btn"]} ${style["bg-color-cst3"]}`}
                  to="/manage"
                >
                  구단관리
                </Link>
                <div className={`${style["btn"]} ${style["bg-color-cst4"]}`}>
                  RESET
                </div>
                <div className={`${style["btn"]} ${style["bg-color-cst5"]}`}>
                  SAVE
                </div>
                <div
                  className={`${style["btn"]} ${style["bg-color-cst6"]}`}
                  onClick={clickToggleBtn}
                >
                  {toggle ? "타자" : "투수"}
                </div>
              </Row>
            </Row>
          </div>
        </Row>
      </DndProvider>
    </>
  );
};

export default Market;
